import React from 'react';
import Slider from "react-slick";
import image1 from "../assets/images/bg_1.jpg";

const Main = () => {
    const settings = {
        dots: true,
        fade: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        waitForAnimate: false
      };
  return (
    <div className="slider-container">
      <Slider className='home-slider' {...settings}>

      </Slider>
    </div>
  )
}

export default Main
